Text:
@JrBirdie

I don't know if this will work or not, but it's worth trying -- view source and find the img src location for the CAPTCHA image, then load it in a new window, and go back to the original upload page tab or window and type in what you see.

Only problem is, it might reload a new image when you manually download it. But it's the only idea I have for working around the broken captcha.
